package pdf

import (
	"encoding/base64"
	"github.com/dgmann/document-manager/pdf-processor/pdfprocessor"
)

const testImage = ""

func NewResult() Result {
	return Result{pdfprocessor.ImageResult{
		Image: GetTestImage(),
		PageNumber: 0,
	}}
}

func GetTestImage() []byte {
	data, _ := base64.StdEncoding.DecodeString(testImage)
	return data
}
